The executors responsibility is to take one or more futures and run them to completion. The first thing an executor does when it gets a Future is polling it. When polled one of three things can happen: The future returns Ready and we schedule whatever chained operations to run The future hasn't been polled before so we pass it a Waker and suspend it The futures has been polled before but is not ready and returns Pending Rust provides a way for the Reactor and Executor to communicate through the Waker. The reactor stores this Waker and calls Waker::wake() on it once a Future has resolved and should be polled again. Our Executor will look like this: // Our executor takes any object which implements the `Future` trait
fn block_on<F: Future>(mut future: F) -> F::Output { // the first thing we do is to construct a `Waker` which we'll pass on to // the `reactor` so it can wake us up when an event is ready. let mywaker = Arc::new(MyWaker{ thread: thread::current() }); let waker = waker_into_waker(Arc::into_raw(mywaker)); // The context struct is just a wrapper for a `Waker` object. Maybe in the // future this will do more, but right now it's just a wrapper. let mut cx = Context::from_waker(&waker); // We poll in a loop, but it's not a busy loop. It will only run when // an event occurs, or a thread has a "spurious wakeup" (an unexpected wakeup // that can happen for no good reason). let val = loop { // So, since we run this on one thread and run one future to completion // we can pin the `Future` to the stack. This is unsafe, but saves an // allocation. We could `Box::pin` it too if we wanted. This is however // safe since we don't move the `Future` here. let pinned = unsafe { Pin::new_unchecked(&mut future) }; match Future::poll(pinned, &mut cx) { // when the Future is ready we're finished Poll::Ready(val) => break val, // If we get a `pending` future we just go to sleep... Poll::Pending => thread::park(), }; }; val
} Inn all the examples here I've chose to comment the code extensively. I find it easier to follow that way than dividing if up into many paragraphs. We'll see more about the Waker in the next paragraph, but just look at it like a trait object similar to the one we constructed in the first chapter. Context is just a wrapper around the Waker. At the time of writing this book it's nothing more. In the future it might be possible that the Context object will do more than just wrapping a Future so having this extra abstraction gives some flexibility. You'll notice how we use Pin here to pin the future when we poll it. Now that you've read so much about Generators and Pin already this should be rather easy to understand. Future is a state machine, every await point is a yield point. We could borrow data across await points and we meet the exact same challenges as we do when borrowing across yield points. As we explained in the chapter about generators , we use Pin and the guarantees that give us to allow Futures to have self references.

